#include<iostream>
int main() {
	int ax, ay, bx, by, cx, cy, dx, dy;
	std::cin >> ax >> ay >> bx >> by >> cx >> cy >> dx >> dy;
	if (ax - cx == bx - dy == ay - cy == by - dy) {
		std::cout << "Parallel" << std::endl;
	}
	else {
		std::cout << "Intersect" << std::endl;
	}
	return 0;
}
